const years = [2025, 2026, 2027, 2028, 2029, 2030, 2031, 2032, 2033, 2034, 2035];
let activeScenario = null;
let selectedRegion = null;
let chart = null;

function init() {
    const buttonsContainer = document.getElementById('scenarioButtons');
    for (let i = 1; i <= 4; i++) {
        const btn = document.createElement('button');
        btn.className = 'btn btn-scenario';
        btn.textContent = scenarios[i].name;
        btn.onclick = () => selectScenario(i);
        buttonsContainer.appendChild(btn);
    }
    renderMap();
}

function selectScenario(num) {
    activeScenario = num;
    selectedRegion = null;
    
    document.querySelectorAll('.btn-scenario').forEach((btn, idx) => {
        btn.classList.toggle('active', idx + 1 === num);
    });

    const info = document.getElementById('scenarioInfo');
    info.style.display = 'block';
    info.className = 'scenario-info';
    
    let infoHTML = `<h3 style="text-align: center;">${scenarios[num].title}</h3>`;
    infoHTML += `<p style="color: #374151; margin-bottom: 0.25rem; text-align: center;">${scenarios[num].description}</p>`;
    
    if (scenarios[num].subtitle) {
        infoHTML += `<p style="font-size: 0.875rem; color: #059669; font-weight: 600; text-align: center;">${scenarios[num].subtitle}</p>`;
    }
    
    info.innerHTML = infoHTML;

    document.getElementById('infoText').style.display = 'block';
    document.getElementById('mapCard').style.display = 'block';
    
    // Меняем заголовок карты в зависимости от сценария
    const mapTitle = document.querySelector('#mapCard h3');
    if (mapTitle) {
        mapTitle.textContent = num === 4 ? 'Карта Беларуси' : 'Карта России';
    }
    
    // Показываем таблицу для всех сценариев
    document.getElementById('dataTableCard').style.display = 'block';
    renderDataTable(num);
    
    document.getElementById('chartCard').style.display = 'block';
    
    renderMap();
    updateChart();
}

function renderDataTable(scenarioNum) {
    const scenario = scenarios[scenarioNum];
    const tableTitle = document.getElementById('tableTitle');
    const headerRow = document.getElementById('tableHeaderRow');
    const tableBody = document.getElementById('tableBody');
    
    tableTitle.textContent = scenario.title;
    
    headerRow.innerHTML = '<th>Регионы (терруары)</th>';
    years.forEach(year => {
        headerRow.innerHTML += `<th>${year}</th>`;
    });
    
    tableBody.innerHTML = '';
    Object.entries(scenario.regions).forEach(([region, values]) => {
        const row = document.createElement('tr');
        row.innerHTML = `<td>${region}</td>`;
        values.forEach(value => {
            row.innerHTML += `<td>${value}</td>`;
        });
        tableBody.appendChild(row);
    });
}

function renderMap() {
    const svg = document.getElementById('mapSvg');
    
    // Для 4-го сценария используем другой viewBox для карты Беларуси
    if (activeScenario === 4) {
        svg.setAttribute('viewBox', '-500 -100 2000 1400');
    } else {
        svg.setAttribute('viewBox', '0 0 1000 600');
    }
    
    svg.innerHTML = `
        <defs>
            <filter id="glow">
                <feGaussianBlur stdDeviation="2.5" result="coloredBlur"/>
                <feMerge>
                    <feMergeNode in="coloredBlur"/>
                    <feMergeNode in="SourceGraphic"/>
                </feMerge>
            </filter>
            <linearGradient id="activeGradient" x1="0%" y1="0%" x2="100%" y2="100%">
                <stop offset="0%" stop-color="#10b981" stop-opacity="0.9"/>
                <stop offset="100%" stop-color="#059669" stop-opacity="1"/>
            </linearGradient>
        </defs>
    `;

    // Белорусские регионы
    const belarusRegions = ['Брестская область', 'Гомельская область', 'Гродненская область', 
                            'Минская область', 'Могилёвская область', 'Витебская область', 'Город Минск'];

    Object.entries(regionPaths).forEach(([name, path]) => {
        // В 4-м сценарии показываем только белорусские области
        if (activeScenario === 4 && !belarusRegions.includes(name)) {
            return;
        }
        
        // В сценариях 1-3 показываем только российские регионы
        if (activeScenario && activeScenario !== 4 && belarusRegions.includes(name)) {
            return;
        }
        
        const isActive = activeScenario && scenarios[activeScenario].regions[name];
        const isSelected = selectedRegion === name;
        
        const pathEl = document.createElementNS('http://www.w3.org/2000/svg', 'path');
        pathEl.setAttribute('d', path);
        pathEl.setAttribute('fill', isSelected ? 'url(#activeGradient)' : isActive ? '#34d399' : '#e5e7eb');
        pathEl.setAttribute('stroke', isSelected ? '#065f46' : isActive ? '#218362ff' : '#0d0e12ff');
        pathEl.setAttribute('stroke-width', isSelected ? '2' : '0.8');
        pathEl.setAttribute('opacity', isActive ? (isSelected ? '1' : '0.85') : '0.3');
        pathEl.setAttribute('filter', isSelected ? 'url(#glow)' : '');
        pathEl.style.cursor = isActive ? 'pointer' : 'default';

        if (isActive) {
            pathEl.onmouseover = () => {
                pathEl.setAttribute('stroke-width', '1.5');
            };
            pathEl.onmouseout = () => {
                pathEl.setAttribute('stroke-width', isSelected ? '2' : '0.8');
            };
            pathEl.onclick = () => selectRegion(name);
        }

        svg.appendChild(pathEl);
    });

    const legend = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    // Для 4-го сценария смещаем легенду с учетом нового viewBox
    if (activeScenario === 4) {
        legend.setAttribute('transform', 'translate(975, 1150) scale(1.8)');
    } else {
        legend.setAttribute('transform', 'translate(700, 520)');
    }
    
    legend.innerHTML = `
        <rect x="0" y="0" width="280" height="70" fill="white" stroke="#10b981" stroke-width="2" rx="5" opacity="0.95"/>
        <rect x="10" y="10" width="25" height="15" fill="#34d399"/>
        <text x="40" y="22" style="font-size: 12px; fill: #374151;">Активные регионы</text>
        <rect x="10" y="30" width="25" height="15" fill="#e5e7eb"/>
        <text x="40" y="42" style="font-size: 12px; fill: #374151;">Неактивные регионы</text>
        <rect x="10" y="50" width="25" height="10" fill="url(#activeGradient)"/>
        <text x="40" y="60" style="font-size: 12px; fill: #374151;">Выбранный регион</text>
    `;
    svg.appendChild(legend);
}

function selectRegion(name) {
    selectedRegion = name;
    renderMap();
    showRegionInfo(name);
    updateChart();
}

function showRegionInfo(name) {
    const info = document.getElementById('regionInfo');
    const data = scenarios[activeScenario].regions[name];
    const growth = Math.round((data[10] / data[0] - 1) * 100);

    info.style.display = 'block';
    info.className = 'region-info';
    info.innerHTML = `
        <button class="close-btn" onclick="closeRegionInfo()">×</button>
        <h3>${name}</h3>
        <div style="margin-top: 0.5rem;">
            <p style="font-size: 0.875rem; margin-bottom: 0.5rem;">
                <span style="font-weight: 600; color: #374151;">Площадь закладки (2025):</span>
                <span style="margin-left: 0.5rem; color: #059669; font-weight: bold;">${data[0]} га</span>
            </p>
            <p style="font-size: 0.875rem; margin-bottom: 0.5rem;">
                <span style="font-weight: 600; color: #374151;">Прогноз (2035):</span>
                <span style="margin-left: 0.5rem; color: #059669; font-weight: bold;">${data[10]} га</span>
            </p>
            <div style="padding-top: 0.5rem; border-top: 1px solid #e5e7eb;">
                <p style="font-size: 0.75rem; color: #4b5563;">
                    Рост за 10 лет: <span style="font-weight: bold; color: #059669;">${growth}%</span>
                </p>
            </div>
        </div>
    `;
}

function closeRegionInfo() {
    selectedRegion = null;
    document.getElementById('regionInfo').style.display = 'none';
    renderMap();
}

function updateChart() {
    if (!activeScenario) return;

    let data, label;
    if (selectedRegion) {
        const regionData = scenarios[activeScenario].regions[selectedRegion];
        data = regionData;
        label = selectedRegion;
        document.getElementById('chartTitle').textContent = `Динамика развития: ${selectedRegion}`;
    } else {
        const totalData = years.map((_, idx) => {
            return Object.values(scenarios[activeScenario].regions).reduce((sum, values) => sum + values[idx], 0);
        });
        data = totalData;
        label = 'Общая площадь';
        document.getElementById('chartTitle').textContent = `Общая динамика — ${scenarios[activeScenario].title}`;
    }

    const ctx = document.getElementById('myChart');
    
    if (chart) {
        chart.destroy();
    }

    chart = new Chart(ctx, {
        type: 'line',
        data: {
            labels: years,
            datasets: [{
                label: 'Площадь (га)',
                data: data,
                borderColor: '#059669',
                backgroundColor: 'rgba(5, 150, 105, 0.1)',
                borderWidth: 4,
                pointRadius: 6,
                pointBackgroundColor: '#10b981',
                pointBorderColor: '#fff',
                pointBorderWidth: 2,
                pointHoverRadius: 9,
                tension: 0.4
            }]
        },
        options: {
            responsive: true,
            maintainAspectRatio: true,
            plugins: {
                legend: {
                    labels: {
                        font: { size: 14, weight: 'bold' },
                        color: '#065f46'
                    }
                },
                tooltip: {
                    backgroundColor: '#f0fdf4',
                    titleColor: '#065f46',
                    bodyColor: '#047857',
                    borderColor: '#10b981',
                    borderWidth: 2,
                    padding: 12,
                    titleFont: { size: 14, weight: 'bold' },
                    bodyFont: { size: 13, weight: 'bold' }
                }
            },
            scales: {
                y: {
                    beginAtZero: true,
                    ticks: {
                        font: { size: 12, weight: 'bold' },
                        color: '#047857'
                    },
                    title: {
                        display: true,
                        text: 'Площадь (га)',
                        font: { size: 13, weight: 'bold' },
                        color: '#065f46'
                    }
                },
                x: {
                    ticks: {
                        font: { size: 12, weight: 'bold' },
                        color: '#047857'
                    }
                }
            }
        }
    });
}

function showContacts() {
    document.getElementById('contactsModal').classList.add('show');
}

function hideContacts() {
    document.getElementById('contactsModal').classList.remove('show');
}

function showPresentation() {
    document.getElementById('presentationModal').classList.add('show');
}

function hidePresentation() {
    document.getElementById('presentationModal').classList.remove('show');
}

window.onclick = function(event) {
    if (event.target.classList.contains('modal')) {
        event.target.classList.remove('show');
    }
};

init();